class ProfileBillingComponent {
    constructor(router, activatedRoute, paymentService) {
        this.router = router;
        this.activatedRoute = activatedRoute;
        this.paymentService = paymentService;
        this.page = 0;
        this.limit = 10;
        this.totalCount = 0;
        this.billsList = [];
    }
    ngOnInit() {
        this.activatedRoute.params.subscribe(params => {
            console.log(params);
            console.log(params['id']);
            this.id = params['id'];
            if (this.id) {
                this.getAll(this.id);
            }
        });
    }
    addBill() {
        this.router.navigate(['app/payment/add/']);
    }
    getAll(id) {
        this.paymentService.getByPatient(id, this.page, this.limit).subscribe((res) => {
            if (res.status == '200') {
                console.log(res);
                this.billsList = res.data.doc;
                this.totalCount = res.data.count;
            }
            else {
                this.billsList = [];
            }
        });
    }
    onClick(id) {
        this.router.navigate(['/app/payment/invoice/', id]);
    }
    onClickPage(page = 0) {
        this.page = page;
        this.getAll(this.id);
    }
    getSubTotal(i) {
        let subTotal = 0;
        this.billsList[i].items.forEach(a => subTotal += (a.price * a.quantity));
        return subTotal;
    }
    applyDiscount(i) {
        return this.getSubTotal(i) - (this.getSubTotal(i) * (this.billsList[i].discount / 100));
    }
}


